import { Height } from "@material-ui/icons";
import React from "react";
import "./AdminPanel.css";
export default function AdminPanel() {
  return (
    <div className="body container">
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">Admin Panel</h5>
          <div className="row">
              
            <h6 className="card-subtitle mb-3 text-muted">Enter UserName</h6>
            <input type="text" className="input__field" />
            <h6 className="card-subtitle mb-3 text-muted">Enter Password</h6>
            <input type="text" className="input__field" />
          </div>
        </div>
        <input type="submit" className="input__submit" />
      </div>
    </div>
  );
}
